  async function getPhotos(){
    try{
      const res = await fetch(url);
      const data = await res.json();
      console.log(data);
    } catch(error){

    }
  }

  return (
    <div>
      <Title title='Dog Image Genterator'/>
      <Photo/>
    </div>
  );
}

export default App;
